      out.write("\t\t\t\t\tfor (i = 0; i < dropdown.length; i++) {\r\n");
      out.write("\t\t\t\t\t\tdropdown[i].addEventListener(\"click\", function () {\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t\tvar dropdownContent = this.nextElementSibling;\r\n");
      out.write("\t\t\t\t\t\t\tif (dropdownContent.style.display === \"block\") {\r\n");
      out.write("\t\t\t\t\t\t\t\tdropdownContent.style.display = \"none\";\r\n");
