      out.write("\t\t\t\t\tfunction updateData() {\r\n");
      out.write("\t\t\t\t\t\tvar request = new XMLHttpRequest();\r\n");
      out.write("\t\t\t\t\t\trequest.open('GET', '/smartqueueweb/JsonStudentListAPI');\r\n");
      out.write("\t\t\t\t\t\trequest.onload = function () {\r\n");
      out.write("\t\t\t\t\t\t\tvar data = JSON.parse(request.responseText);\r\n");
      out.write("\t\t\t\t\t\t\trenderHTML(data);\r\n");
      out.write("\t\t\t\t\t\t}\r\n");
      out.write("\t\t\t\t\t\trequest.send();\r\n");
      out.write("\t\t\t\t\t}\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\tfunction renderHTML(data) {\r\n");
      out.write("\t\t\t\t\t\tvar htmlString = ``;\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\tfor (var i = 0; i < data.length; i++) {\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t\thtmlString += \"<tr>\";\r\n");
      out.write("\t\t\t\t\t\t\thtmlString += \"<td>\" + data[i].idnumber + \"</td>\";\r\n");
      out.write("\t\t\t\t\t\t\thtmlString += \"<td>\" + data[i].firstname + \" \" + data[i].middlename + \" \" + data[i].lastname + \" </td>\";\r\n");
      out.write("\t\t\t\t\t\t\thtmlString += \"<td>\" + data[i].course + \"</td>\";\r\n");
      out.write("\t\t\t\t\t\t\thtmlString += '<td><button onclick=\"updateStudent(' + data[i].idnumber + ', \\'' + data[i].firstname + '\\', \\'' + data[i].middlename + '\\', \\'' + data[i].lastname + '\\', \\'' + data[i].course + '\\')\" class=\"update\" style=\"background-color: #97BE5A;\">Update</button> ';\r\n");
      out.write("\t\t\t\t\t\t\thtmlString += '<button onclick=\"removeStudent(' + data[i].idnumber + ')\" button class=\"delete\" style=\"background-color: #EE4E4E;\">Delete</button>';\r\n");
      out.write("\t\t\t\t\t\t\thtmlString += \"</tr>\";\r\n");
      out.write("\t\t\t\t\t\t}\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\tstaffListInfo.innerHTML = htmlString;\r\n");
      out.write("\t\t\t\t\t}\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\tsetInterval(updateData, 2000);\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t</script>\r\n");
